INSERT INTO `objectives` (`id`, `title`, `content`) VALUES
(1, 'Socio-economic Empowerment', '<p>\r\n\r\n</p><h4>Socio-economic empowerment</h4><p>Wamusai Simiyu Foundation, seeks to interrupt poverty cycles and dependency of women, youth and other vulnerable groups by facilitating access to economic empowerment opportunities that will enable them initiate and run Income Generating Activities. The organization is cognizant of international recognition that equality for vulnerable groups is good for economic growth and essential for poverty reduction. This will involve providing interprenuership development and capacity building activities to the women, youth and PLWDs in the community. Key project activities will include cottage industrial skills training and business support.</p>\r\n\r\n<br><p></p>'),
(2, 'Education', '<p>\r\n\r\n</p><h4>Education as our Objective</h4><p>To promote the bright children from poor families to have access to quality education, to get equal opportunities for better education in the society, fight illiteracy, eradicate poverty and rescue a girl child in our societies who are sometimes looked up on as useless persons in our families to get a chance to have better education like boys, many of them drop out of school due to lack of school fees leading to early pregnancies and marriages caused by frustrations of lack of school fees, poverty and idleness. To educate and engage the public concerning the causes, effects and means of eradication of such school dropout cases, poverty eradication and to strengthen the capacity and action of the poor .</p><p>To fund bright students from poor backgrounds through scholarships to join colleges both locally and abroad, to have equal opportunities denied by their poor or poverty background in the society. Special attention or first priorities to be given to the Orphans and children from single parents.</p>\r\n\r\n<br><p></p>'),
(3, 'Health', '<p>\r\n\r\n</p><h4>Health as our Objective</h4><p>To increase the quality, availability and effectiveness of educational and community based programs designed to prevent diseases, injuries, improve health, prevent/reduce mortality rates by providing clean/conducive environment for expectant mothers during child birth and enhance quality of life.</p><p>To create awareness and give information to sensitize our people in the society in regard to HIV/AIDS epidemic among Children, women and other person affected by HIV/AID in the society and the stigma surrounding them, special attention to children who were born HIV positive in which the country has recorded a number of cases of suicide in our societies caused by the stigma surrounding them. In many cases, the stigma surrounding these people especially women and children leads to discrimination and this makes many young people/children to commit suicide. In some cases, women fear and hide their HIV/AIDS status because of stigma surrounding them in our society. This fear makes them to avoid checkups in hospitals to take correct medication.</p><p>To empower the girl child through education, counsel and support services to reduce risks of unwanted pregnancies and related complications. More emphasize will be to counsel, encourage and support individual talents among the girl child.</p><p>To start income generating projects such as general investments, Crop farming, Animal and poultry keeping and also participating in tendering processes in our counties.</p><p>To create employment opportunities through our initiated projects and through tendering participation processes in both national and county governments. The much emphasis is on self-employment among us members and our youths</p><p>To build unity among the family members and support family members at the time of need and emergency and support one another through our unity strength.</p><p>To promote and facilitate improvement of education among our people. More emphasize to orphans and unprivileged children from poor families to have access to better Education through Bursaries and scholarships.</p><p>To liaising with both County and National governments and other similar group or organizations and the society in general on matters concerning the improvement of lives for people in the communities especially women and children.</p><p>To initiate water projects in our society where by the foundation will initiate some water projects to bring clean drinking water closer to the people in the society. Most mothers in our societies walk long distances in search for clean drinking water for their families and as we understand in our society, water is an essential commodities and water is life.</p><p>To promote and build the capacities of the communities to respond and cope with the management, upbringing and education of needy children.</p><p>To promote developmental interventions which empower the members of our society to alleviate both poverty and household food insecurity and by so doing enable them take total charge of the destiny of their families. This will reduce the poverty level in our society.</p><p>To promote and launch campaign against detrimental cultural practices which compromise the education development of disadvantaged children in Kenya. To facilitate the organization and implementation of community based programs which trigger household incomes leading to improved family child support/care.</p><p>To endeavor to sensitize and educate the society on child Labour, child abuse and neglect as a social vice. Problems such as poverty, lack of education, abandonment of children and forced Labour will be addressed. An effort will be made to offer support to victims of the same. Education for every child will be encouraged and supported through bursaries and scholarships assistance. To provide support and counseling services to Victims of child labor, child abuse, and child neglect, rape, sexual abuse, domestic violence and other misfortunes of a related nature.</p><p>To address the problem of domestic violence. Focus will be on spouse battering, neglect of responsibilities, addiction to Alcohol, drug abuse, problems related to large and extended families, lack of proper Communication between spouses and the traditional view on gender traits.</p><p>To promote and conserve environment especially campaigning for planting of more trees and protecting forests in the water catchment areas. Members shall start planting and raising the Tree seedling Nurseries.</p><p>The people of the society will be educated to be able to compare and contrast the role of women and men in the modern society and appreciate to make a decisive balance. Stress will be on gender value and balance. Respect will be instilled on either side, hence promote co-existence, proper sharing of power and distribution of resources will be emphasized.</p><p>To empower the girl child through education, counsel and support services to reduce risks of unwanted pregnancies and related complications. More emphasize will be to counsel, encourage and support individual talents among the girl child.</p><p>To support and strengthen the African Traditional Community childcare systems for the HIV/AIDS epidemic orphans in order to maintain their family inheritance. To create awareness and information among our people not to belief that HIV/AIDS is a dead sentence. This belief makes the victim to lose hope in life thinking that there is no cure for the epidemic. To creates awareness and information in HIV/AIDS among the marginalized people in this country.</p>\r\n\r\n<br><p></p>'),
(4, 'Climate Change', '<p>\r\n\r\n</p><h4>WSF Climate change</h4><p>Wamusai Simiyu Foundation, will endeavor to help individuals , communities and natural systems to deal with the consequences of climate change that are unavoidable. It will involve taking practical actions to manage risks from climate impact, protect communities and strengthen resilience of the economy. Through such actions, individuals and communities will be best placed to make adaptation decisions that will reduce climate risks to their livelihoods. It\'s also important to note that the organization will carry out extensive and intensive research on climate change and adaptation Agriculture..</p>\r\n\r\n<br><p></p>');

