INSERT INTO `pages` (`id`, `title`, `content`) VALUES
(1, 'Vision & Mission', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                          \r\n                          <div>                          \r\n                            <h4>Moto:</h4>                          \r\n                            <p>Utmost Humanity, Godâ€™s Service. . </p>\r\n                          </div>\r\n                          <div>                          \r\n                            <h4>Mission:</h4>                          \r\n                            <p>Inspire, Educate, Empower And Connect People for a Just and Developed Society.. </p>\r\n                          </div>\r\n                          <div>                          \r\n                            <h4>Vission:</h4>                          \r\n                            <p>Open Opportunities for the Less Fortunate. </p>\r\n                          </div>\r\n                          <div>                          \r\n                            <h4>Core Values:</h4>                          \r\n                            <p>Unity, Humanity, God\'s Service, Equity, Equality, Honesty. </p>\r\n                          </div>\r\n                                           \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(2, 'Service Charter', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>                      \r\n                          <div>                          \r\n                            <h4><u></u>Customer Service Commitment<u></u></h4>                          \r\n                            <p>We are committed to the delivery of \r\nhumanitarian and charitable services to the populace of Bungoma County \r\nand Kenya at large. We commit to satisfy every client that comes to our \r\noffices, service centers and call centers for services. </p>\r\n                          </div>  \r\n                          <div>                          \r\n                            <h4><u></u>Our Promise<u></u></h4>                          \r\n                            <p>\r\n                            Serve you with a smile and be pleasant when \r\ninteracting with you. \r\n                            Ensure that you are handled professionally, \r\nwith courtesy, efficiency and objectivity. Strive to always \r\n                            capture your feedback to enable us enhance \r\nyour experience. \r\n                            Create a Digital Experience that is \r\nPersonalized, Easy and Instant <b> In serving our esteemed clients </b> ,\r\n the foundation shall:\r\n                            Take ownership and personal responsibility \r\nfor all our action when handling your concerns. We Endeavor to provide \r\nyou with complete and correct information, and solutions at first \r\ncontact. Besides, we endeavor to exceed your expectation with our \r\nknowledge and proactive &amp; personalized approach to keep you \r\nsatisfied and happy. We will respond to your requests with transparency \r\nand honesty, within the agreed timelines. In addition, we will keep you \r\nregularly updated on the progress of your requests.\r\n\r\n                            </p>\r\n                          </div>                                         \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p><br><br>'),
(3, 'Our Assurance', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>                      \r\n                          <div>                          \r\n                            <h4><u></u>Our Assurance<u></u></h4>                          \r\n                            <p>We commit to uphold your privacy and \r\nconfidentiality and at all times. We will create clear and stringent \r\ninternal measures to ensure you receive the best service throughout our \r\nphilanthropic engagements.  The foundation shall act in accordance with \r\nthe laws of the land. </p>\r\n                          </div>                                        \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p><br>'),
(4, 'Our Profile', '<p>\r\n\r\n</p><h4>Who we are</h4><p><b>WAMUSAI SIMIYU FOUNDATION </b>(W.S.F.) is a Non-Profit Making, Non-Political and Non-Partisan Foundation founded on the Principles and values of humanity, skilled population, poverty alleviation, quality Medicare, excellent education, appreciation of human labor, dignity and value among Kenyans and Africans in rural Africa.</p><p>The Principle aim of this foundation is to support young promising youths from poor or unprivileged backgrounds to have access to quality education and to enable them climb a ladder of higher learning, to reach greater heights so that they can serve our society better tomorrow and promote love, peace and harmony among the members of our communities leaving in the same societies. .</p><p>This Foundation is a humanitarian, Philanthropic and people centered mission of giving back to the community through well planned and coordinated co-operational social responsibility that is both result and quality oriented.</p>\r\n\r\n<br><p></p>'),
(5, 'Donate', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>                      \r\n                          <div>                          \r\n                           <?php \r\ninclude \'partials/head.php\';\r\ninclude \'partials/navbar.php\';\r\n?>\r\n<div class=\"article_text\">\r\n		<p><span style=\"font-size: 14pt;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp; Payment Procedure</strong></span></p>\r\n<ol>\r\n<li>Go to Mpesa App</li>\r\n<li>Select \"Payment Services\"</li>\r\n<li>Select \"Pay bill\" .</li>\r\n<li>Select \"Enter Business Number\".</li>\r\n<li>Enter  \"<strong>648992</strong> as the Business Number\".</li>\r\n<li>Select \"Enter Account Number\".</li>\r\n<li>Enter \"<strong>01128782576500</strong> as the Account Number\".</li>\r\n<li>Enter Amount.</li>\r\n<li>Press \"OK\" After ensuring you have entered the correct credentials.</li>\r\n<li>You will then Receive a \"Confirmation Message\" from MPesa.</li>\r\n</ol>\r\n<?php \r\ninclude \'partials/footer_scripts.php\';\r\n?>\r\n                          </div>                                        \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p><br>');

