INSERT INTO `programs` (`id`, `title`, `content`) VALUES
(1, 'Bursaries', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h1>WSF Bursary Program</h1>   \r\n                               <p>\r\n                               It is through this bursary fund that the \r\norganization was founded. Hon. Wamusai started the bursary fund when he \r\nfirst became Member of county assembly for Siboti ward. It is nearly 2 \r\nyears now since the kitty was started. Since its launch, the fund has \r\nbenefited over 35 students, and this is a milestone in the improvement \r\nof literacy level and realization of millennium development goals. The \r\nfoundation intends to cater for deserving cases countrywide.\r\nIn order to make fund self-sustaining, the foundation will launch an \r\nendowment fund where interested individuals, alumni and other \r\norganizations can support the kitty.\r\n\r\n                               </p>\r\n                            </div>\r\n                                           \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(2, 'Children & Elderly rescue', '<p>\r\n</p><p>\r\n</p><h4>Childrenâ€™s Rescue Centre and Home for the Elderly</h4>\r\n\r\n\r\n                               <p></p><p>Wamusai Foundation Childrenâ€™s Home seeks \r\nto address the plight of children orphaned or made vulnerable as a \r\nresult of HIV/AIDS, chronic diseases and extreme poverty. Wamusai \r\nFoundation Childrenâ€™s Homeâ€™s mission is to co-operate and collaborate \r\nwith like-minded organizations, individuals, local authorities and \r\nmembers of the community to offer a chance for better life and a new \r\nstart to orphans and other vulnerable children.\r\nThis is by giving them a first-class education, access to necessary \r\nhealth services and, above all, the opportunity to grow up healthy and \r\nhappy in a safe, caring, warm and familial environment.\r\n\r\n                               </p>\r\n                               <p>\r\n                               This is by giving them a first-class \r\neducation, access to necessary health services and, above all, the \r\nopportunity to grow up healthy and happy in a safe, caring, warm and \r\nfamilial environment.\r\n                               </p>\r\n\r\n<br><p></p>'),
(3, 'Mentorship', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>WSF Mentorship Programmes</h4>   \r\n                            <p>Due to the need of giving hope for a \r\nbetter future to the youth, the Wamusai Foundation conducts an annual \r\nmentorship program. The knowledge and alternatives gained through the \r\nmentorship program allows young adults to explore different career \r\npossibilities that are not often available in a classroom or work \r\nsetting. Further, the mentor helps in breaking down stereotypes \r\nsurrounding certain professions and populations.\r\n                               </p>\r\n                            </div>\r\n                                           \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(4, 'Safe water', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>WSF Water Programmes</h4>   \r\n                            <p>\r\n                            The foundation has launched water \r\ninterventions projects  aimed  at drilling 50 boreholes in the county. \r\nThe foundation will endeavor to assist communities to harness reliable \r\nwater sources for their use and that of livestock and for agricultural \r\nuse. The foundation will mobilize all interested parties in initiating \r\nthe water intervention chapter geared at helping Kenyans have enough \r\nfood and water for use. \r\n                            </p>\r\n                            </div>\r\n                                           \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(5, 'HIV / AIDS', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>WSF HIV/AIDs Programmes</h4>   \r\n                            <p>\r\n                            The foundation has launched water \r\ninterventions projects  aimed  at drilling 50 boreholes in the county. \r\nThe foundation will endeavor to assist communities to harness reliable \r\nwater sources for their use and that of livestock and for agricultural \r\nuse. The foundation will mobilize all interested parties in initiating \r\nthe water intervention chapter geared at helping Kenyans have enough \r\nfood and water for use. \r\n                            </p>\r\n                            </div>\r\n                                           \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(6, 'Digital village', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>WSF Digital Village</h4>   \r\n                            <p>\r\n                            The Wamusai Foundation will open New \r\nInformation Centers with an aim of providing interested individuals and \r\nprofessionals working in the field of community development in rural \r\nareas with a â€œone-stop-shopâ€ for the retrieval and exchange of \r\ndevelopment information and data. These are centers where people come \r\nand acquire training and skills aimed at accelerating development agenda\r\n within the region.\r\n                            </p>\r\n                            </div>\r\n                                           \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(7, 'Linda Wajane', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>WSF Linda wajane</h4>   \r\n                            <p>\r\n                            The Wamusai Foundation will set up a \r\nfacility to host the homeless â€œWajanesâ€. It will provide them with there\r\n basic needs   and train them vocationally. This training will assist \r\nthem generate some money for their upkeep and also provide employment \r\nfor those that are strong and well able to work.\r\n                            </p>\r\n                            </div>                                          \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(8, 'Linda Wazee', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>WSF Linda wazee</h4>   \r\n                            <p>\r\n                            The Wamusai Foundation will open a home for \r\nthe â€œWazeeâ€. The home will employ nurses to cater for their needs \r\nincluding bathing, dressing, cooking and cleaning.\r\n                            </p>\r\n                            </div>                                          \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(9, 'Talent Nurturing & Development', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>Talent Nurturing and Development</h4>   \r\n                            <p>\r\n                            The Wamusai Foundation will setup a facility\r\n where the various talented people can be Coached and also organize \r\nshows to help them showcase their talents to the world.\r\n                            </p>\r\n                            </div>                                          \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>'),
(10, 'Environmental Conservation', '<p>\r\n</p><div>\r\n                  <div>\r\n                    <div>\r\n                      <div>\r\n                       \r\n                          <div>                          \r\n                            <h4>WSF Environment Conservation Programme</h4>   \r\n                            <p>\r\n                            The Wamusai Foundation will encourage the \r\nsociety to use reusable bags, possibly \r\nPrint as little as possible, to select products made from recycled \r\nmaterials or designed to be safer from the environment, to use \r\nelectricity appropriately ,avoid using public means of transport etc\r\n.\r\n                            </p>\r\n                            </div>                                          \r\n                      </div> \r\n                    </div>                                   \r\n                  </div>\r\n                </div>\r\n\r\n<br><p></p>');

